import "./App.css";
import { Routes, Route } from "react-router-dom";

import Navigationbar from "./Navigationbar";
import Footer from "./Footer";

import Home from "./Home";
import About from "./About";
import Contact from "./Contact";
import DestinationInfo from "./DestinationInfo";

import ReadAllPackages from "./CRUD/ReadAllPackages";
import ReadTours from "./CRUD/ReadTours";
import ReadOne from "./CRUD/ReadOne";
import CreatePackage from "./CRUD/CreatePackage";
import UpdateItem from "./CRUD/UpdateItem";

import Login from "./Auth/Login";
import UserProfile from "./Auth/UserProfile";
import ProtectedRoute from "./Auth/ProtectedRoute";
import { UserContextProvider } from "./Auth/UserContext";

function App() {
  return (
    <UserContextProvider>
      <div className="page-container">
        <Navigationbar />

        <div className="page-content">
          <Routes>
            {/* Public routes */}
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/packages" element={<DestinationInfo />} />
            <Route path="/readAll" element={<ReadAllPackages />} />
            <Route path="/readTours" element={<ReadTours />} />

            {/* Admin login */}
            <Route path="/login" element={<Login />} />

            {/* Protected admin routes */}
            <Route
              path="/readOne/:id"
              element={
                <ProtectedRoute>
                  <ReadOne />
                </ProtectedRoute>
              }
            />
            <Route
              path="/createPackage"
              element={
                <ProtectedRoute>
                  <CreatePackage />
                </ProtectedRoute>
              }
            />
            <Route
              path="/update/:id"
              element={
                <ProtectedRoute>
                  <UpdateItem />
                </ProtectedRoute>
              }
            />
            <Route
              path="/user"
              element={
                <ProtectedRoute>
                  <UserProfile />
                </ProtectedRoute>
              }
            />
          </Routes>
        </div>

        <Footer />
      </div>
    </UserContextProvider>
  );
}

export default App;
